//  *          >   Overall

const Blob = ({
  technologyStack = [],
  color = "#f2f2f2",
  title = "[Title Here]",
}) => {
  const renderBlobItems = technologyStack.map((item) => {
    return <BlobItem />;
  });

  return (
    <div style={{ backgroundColor: `${color}` }}>
      <h2>{title}</h2>
      {renderBlobItems}
    </div>
  );
};

export default Blob;
